import React from "react";

class CatList extends React.Component {
  render() {
    return (
      <ul className='section-cats_list'>
        <li>
          <a>A cat</a>
          <img src='http://lorempixel.com/400/200/cats/' alt='' />
        </li>
        <li>
          <a>Another cat</a>
          <img src='http://lorempixel.com/400/200/cats/' alt='' />
        </li>
        <li>
          <a>Moar cat</a>
          <img src='http://lorempixel.com/400/200/cats/' alt='' />
        </li>
      </ul>
    );
  }
}

export default CatList;
